function Homepage(){

    return(
        <Box className="homepage">            
            <Grid className='description' direction='coloumn' justify='center'>
                <h1>Hi, <span style={{fontSize:'48px'}}>I AM RIPUDAMAN</span> </h1>              

                <footer>
                    Full-Stack Developer
                </footer>

            </Grid>
        </Box>




    )
}

export default Homepage
